  \"2016-05-31T01:08:37.159791\",\n\t\"name\": \"afsc-race-gap-rooper-impacts-of-longline-gear-on-epibenthic-invertebrates\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In order to manage vulnerable benthic habitats,
  such as deep-sea corals and sponges, the impacts of human activity including commercial
  fishing must be known and accounted for. One type of fishing gear whose impact has
  rarely been studied is commercial longline gear. We performed a series of experiments
  in 2013 and 2014 to address this knowledge gap using inertial measurement units
  and underwater cameras. These data area stored as image files, .bcs files and as
  .csv files. \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
